public class InnerUserProfileUserSettingsFactory(Action<Humidifier.SageMaker.UserProfileTypes.UserSettings> factoryAction = null) : SubResourceFactory<Humidifier.SageMaker.UserProfileTypes.UserSettings>
{

    internal InnerUserProfileJupyterLabAppSettingsFactory JupyterLabAppSettingsFactory { get; set; }

    internal InnerUserProfileKernelGatewayAppSettingsFactory KernelGatewayAppSettingsFactory { get; set; }

    internal InnerUserProfileStudioWebPortalSettingsFactory StudioWebPortalSettingsFactory { get; set; }

    internal InnerUserProfileCustomPosixUserConfigFactory CustomPosixUserConfigFactory { get; set; }

    internal InnerUserProfileCodeEditorAppSettingsFactory CodeEditorAppSettingsFactory { get; set; }

    internal InnerUserProfileRStudioServerProAppSettingsFactory RStudioServerProAppSettingsFactory { get; set; }

    internal InnerUserProfileJupyterServerAppSettingsFactory JupyterServerAppSettingsFactory { get; set; }

    internal InnerUserProfileDefaultSpaceStorageSettingsFactory SpaceStorageSettingsFactory { get; set; }

    internal InnerUserProfileSharingSettingsFactory SharingSettingsFactory { get; set; }

    protected override Humidifier.SageMaker.UserProfileTypes.UserSettings Create()
    {
        var userSettingsResult = CreateUserSettings();
        factoryAction?.Invoke(userSettingsResult);

        return userSettingsResult;
    }

    private Humidifier.SageMaker.UserProfileTypes.UserSettings CreateUserSettings()
    {
        var userSettingsResult = new Humidifier.SageMaker.UserProfileTypes.UserSettings();

        return userSettingsResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.UserProfileTypes.UserSettings result)
    {
        base.CreateChildren(result);

        result.JupyterLabAppSettings ??= JupyterLabAppSettingsFactory?.Build();
        result.KernelGatewayAppSettings ??= KernelGatewayAppSettingsFactory?.Build();
        result.StudioWebPortalSettings ??= StudioWebPortalSettingsFactory?.Build();
        result.CustomPosixUserConfig ??= CustomPosixUserConfigFactory?.Build();
        result.CodeEditorAppSettings ??= CodeEditorAppSettingsFactory?.Build();
        result.RStudioServerProAppSettings ??= RStudioServerProAppSettingsFactory?.Build();
        result.JupyterServerAppSettings ??= JupyterServerAppSettingsFactory?.Build();
        result.SpaceStorageSettings ??= SpaceStorageSettingsFactory?.Build();
        result.SharingSettings ??= SharingSettingsFactory?.Build();
    }

} // End Of Class

